    // LocalStrage„ÇíÁÆ°ÁêÜ„Åô„Çã„ÇØ„É©„Çπ
    class Storage {
        constructor(localStorage, localStrageKey, fallbackObject = null) {
            this.fallbackObject = fallbackObject
            this.localStrageKey = localStrageKey
            this.localStorage = localStorage
        }

        get storageContent() {
            const raw = this.localStorage.getItem(this.localStrageKey);
            return raw ? JSON.parse(raw) : this.fallbackObject;
        }

        set storageContent(data) {
            this.localStorage.setItem(this.localStrageKey, JSON.stringify(data))
        }
    }

    // DIÁî®„ÅÆ„Ç™„Éñ„Ç∏„Çß„ÇØ„Éà„Çí‰ΩúÊàê„Åô„ÇãÈñ¢Êï∞
    // „Ç§„É≥„É°„É¢„É™„Åß„Éá„Éº„Çø„Çí‰øùÂ≠ò„Åô„Çã
    function createMemoryStorage() {
        const store = {};
        return {
            getItem(key) {
                return store.hasOwnProperty(key) ? store[key] : null;
            },
            setItem(key, value) {
                store[key] = String(value);
            },
            removeItem(key) {
                delete store[key];
            },
            clear() {
                for (const key in store) delete store[key];
            }
        };
    }

            console.log('‚úÖ „Ç≠„É£„ÉÉ„Ç∑„É•„Åã„ÇâÂèñÂæó');
            return cachedResponse;
        }

        const resp = await fetch(req)

        // fetch„Å´ÊàêÂäü„Åó„Åü„Çâ„Ç≠„É£„ÉÉ„Ç∑„É•„Å´‰øùÂ≠ò
        if (resp.ok) {
            console.log('üåê fetch„Åó„Å¶„Ç≠„É£„ÉÉ„Ç∑„É•„Å∏‰øùÂ≠ò');
            cache.put(req, resp.clone());
        }

        return resp

    function sortCardData(cardData) {
        return cardData.sort((a, b) => Math.abs(a.id.slice(-3) - Math.abs(b.id.slice(-3))))
    }

    // Ê§úÁ¥¢„É≠„Ç∏„ÉÉ„ÇØ
    // queryÊñáÂ≠óÂàó„Å´ÂØæ„Åó„Å¶‰∏ÄËá¥„Åó„Å¶„ÅÑ„ÇãË¶ÅÁ¥†„Çí„É™„Çπ„Éà„Å´„Åó„Å¶Ëøî„Åô„ÄÇ
    function search(query) {
        const data = cardDataList
        const regex = new RegExp(migemo.query(query), "g")
        const mergedResult = [
            data.filter(card => regex.exec(card.name) !== null),
            data.filter(card => regex.exec(card.idol) !== null),
            data.filter(card => regex.exec(card.rarity) !== null),
        ].flat()
        return sortCardData(mergedResult)
    }
